var video = function(ele) {
	var self = this;
	//播放器控件
	this.e = ele;
	this.hls = function(src) {
        this.url=src;
		if(self.objectHls){
			self.objectHls.destroy();
		}
		if ("rtsp"==src.substring(0, 4)) {
			self.flv(src,{converter:true});
			return;
		}
		if (Hls.isSupported()) {
			self.type="hls";
			var hls = new Hls();
			hls.attachMedia(self.e);
			hls.loadSource(src);
			//加载成功-可以播放
			hls.on(Hls.Events.MANIFEST_LOADED, function() {
				self.e.play();
				self.isPlay=true;
			});
			self.objectHls=hls;
		} else {
			console.log("HLS.js插件没有加载");
		}
	}
	this.flv=function(src,config){
		if(self.objectFlv){
			self.objectFlv.destroy();
		}
		if (flvjs.isSupported()) {
			self.type="flv";
			var flvPlayer = flvjs.createPlayer({type: 'flv',url:src,isLive: true,hasAudio: false,hasVideo: true,enableStashBuffer: true},config);
		    flvPlayer.attachMediaElement(self.e);
		    flvPlayer.load();
		    flvPlayer.playd();
		    self.objectFlv=flvPlayer;
		    self.isPlay=true;
		}
	}

    this.stop=function(){
        if(self.type=="hls"){
            self.objectHls.stopLoad();
            self.objectHls.destroy();
        }else if(self.type=="flv"){
            self.objectFlv.unload();
            self.objectFlv.destroy();
        }
    }
	this.drawImage=function(){
		if(self.isPlay){
			var canvas =document.createElement('canvas');
			var context=canvas.getContext("2d");
			canvas.width=1920;
			canvas.height=1080;
			context.drawImage(self.e,0,0,canvas.width,canvas.height);
			canvas.toBlob(function(blob) {
				var a = document.createElement('a');
                a.download = '视频截图.png';
                a.href = window.URL.createObjectURL(blob);
                $("body").append(a);
                a.click();
                $(a).remove();
			},"image/png");
		}
	};
	//海康云台控制
	this.ptz=function(ptzString){
		var dwPTZCommand=0;
		switch(ptzString){
		case "ptz_left_top":
			dwPTZCommand=25;
			break;
		case "ptz_up":
			dwPTZCommand=21;
			break;
		case "ptz_right_top":
			dwPTZCommand=26;
			break;
		case "ptz_right":
			dwPTZCommand=24;
			break;
		case "ptz_right_bottom":
			dwPTZCommand=28;
			break;
		case "ptz_down":
			dwPTZCommand=22;
			break;
		case "ptz_left_bottom":
			dwPTZCommand=27;
			break;
		case "ptz_left":
			dwPTZCommand=23;
			break;
		case "ptz_zoom_in":
			dwPTZCommand=11;
			break;
		case "ptz_zoom_out":
			dwPTZCommand=12;
			break;
		}
		self.hikControl.dwPTZCommand=dwPTZCommand;
		websocket.send("/topic/converter",JSON.stringify({command:"hik",hikControl:self.hikControl}));
	}
	return this;
}
